  show = (data.privileges['MANAGE_POLICY_APPROVAL_WRITE'] !== null && data.privileges['MANAGE_POLICY_APPROVAL_WRITE']) ? true: false;
}
else{
  show = false;
}

components.calculateValue:
value = {};
if(data.finalDocuments)
{
  if(typeof data.finalDocuments === 'object'){
    value = data.finalDocuments;  
  }else{
    var documents = {};
    data.finalDocuments.map(item,key => {
      documents[key] = item;
    });
    value = documents;
  }
}
